INSERT INTO `product_names` (`id`, `value_chain_id`, `product_name`, `product_code`, `product_image`, `product_color`, `product_uom`, `product_description`, `product_images`, `created_at`, `updated_at`) VALUES
(1, 2, 'Fresh Milk', '3G008161', '9', 'White,Cream', 'KG', 'The major constituents of cows\' milk are water (87.4%) and milk solids (12.6%), which includes vitamins, minerals, carbohydrate, fat, and protein. ... The lactose content of milk varies by species. Cows\' milk contains about 4.8% lactose (1212.5 g lactose per cup), whereas human milk has 7% lactose.', '["17,16,15,9,17,16,15,9,18,"]', '2021-12-08 08:06:15', '2021-12-08 08:06:15'),
(2, 2, 'Freshian Heifer', '339648V1', '19', 'Black and White', 'Number', 'Holstein Friesians (often shortened to Holsteins in North America, while the term Friesians is often used in the UK and Ireland) are a breed of dairy cattle that originated in the Dutch provinces of North Holland and Friesland, and Schleswig-Holstein in Northern Germany. They are known as the world\'s highest-producing dairy animals.', '["16,19,16,19,20,"]', '2021-12-08 08:34:03', '2021-12-08 08:34:03'),
(3, 2, 'Kuku Kienyeji', '58N25544', '23', 'Red,Black,white', 'KG', 'Indigenous chickens in Kenya are about 22 million and are kept by 90% of the rural communities in small flocks of up to 30 birds mainly under free range system. ... The names used to describe the common phenotypes in Kenya are-frizzled feathered, naked neck, barred feathered, feathered shanks, bearded and dwarf sized.', '["21,22,23,"]', '2021-12-08 08:39:39', '2021-12-08 08:39:39'),
(4, 5, 'Mayai Kienyeji', '032F4042', '25', 'white', 'Crate', 'The chicken egg is made up of approximately two-thirds white and one-third yolk. ... The yolk contains lipids, vitamins, minerals, and carotenoid pigments. It is considered a rich source of bioavailable lutein and zeaxanthin carotenoids which are present only in the egg yolk.', '["24,25,26,"]', '2021-12-08 08:48:27', '2021-12-08 08:48:27'),
(5, 2, 'Arshire Heifer', '8X077786', '27', 'Brown and White', 'Number', 'Ayrshire cattle is a breed of dairy cattle which was originated from Ayrshire in southwest Scotland. It is a medium sized breed, but very good in milk production. These cattle generally have red and white markings (the red can range from a shade of orange to a dark brown).', '["30,27,28,29,"]', '2021-12-08 09:01:14', '2021-12-08 09:01:14'),
(6, 2, 'Maziwa Mala', '382G5019', '32', 'White', 'KG', 'Soured milk denotes a range of food products produced by the acidification of milk. Acidification, which gives the milk a tart taste, is achieved either through bacterial fermentation or through the addition of an acid, such as lemon juice or vinegar', '["31,32,33,"]', '2021-12-08 09:10:44', '2021-12-08 09:10:44'),
(7, 14, 'Tomato Sauce', '563V2916', '36', 'Red', 'Crates', 'A tomato product that is not as thick as tomato puree but thicker than tomato juice. It generally has its flavor enhanced by the addition of herbs, spices, onion and garlic. Tomato sauce is commercially canned and sold in most food stores. It is used as a base for other sauces and in a variety of dishes', '["34,35,36,"]', '2021-12-08 09:25:02', '2021-12-08 09:25:02'),
(8, 14, 'Fresh Tomatoes', '561Z8837', '37', 'red, scarlet,yellow', 'KG', 'They are usually red, scarlet, or yellow, though green and purple varieties do exist, and they vary in shape from almost spherical to oval and elongate to pear-shaped. Each fruit contains at least two cells of small seeds surrounded by jellylike pulp. hothouse tomatoes.', '["37,38,39,"]', '2021-12-08 09:29:03', '2021-12-08 09:29:03'),
(9, 17, 'Natural Honey', '36E32265', '42', 'Brown,Wax', 'KG', 'Honey is a sweet liquid made by bees using nectar from flowers. ... Honey is available raw or pasteurized and in a variety of color grades. On average, it contains about 80% sugar. People remove honey from the hive and bottle it directly, so it may also contain trace amounts of yeast, wax, and pollen', '["40,41,42,"]', '2021-12-08 09:34:55', '2021-12-08 09:34:55'),
(10, 3, 'Kales', '8R437718', '45', 'Green', 'KG', 'kale, (Brassica oleracea, variety acephala), loose-leafed edible plant derived from the cabbage of the mustard family (Brassicaceae). ... The leaves are typically blue-green in colour but can also be light green, red, or purple, depending on the variety.', '["43,44,45,"]', '2021-12-08 09:44:08', '2021-12-08 09:44:08'),
(11, 19, 'White Cassava', '4287570E', '47', 'Root', 'KG', 'Cassava is a perennial plant with conspicuous, almost palmate (fan-shaped) leaves resembling those of the related castor-oil plant but more deeply parted into five to nine lobes. The fleshy roots are reminiscent of dahlia tubers. Different varieties range from low herbs to branching shrubs and slender unbranched trees.', '["46,47,48,"]', '2021-12-08 09:48:49', '2021-12-08 09:48:49'),
(12, 30, 'Fresh Water Melon', '666894J5', '51', 'Green', 'KG', 'The watermelon is a large fruit of a more or less spherical shape. ... It has an oval or spherical shape and a dark green and smooth rind, sometimes showing irregular areas of a pale green colour. It has a sweet, juicy, refreshing flesh of yellowish or reddish colour, containing multiple black, brown or white pips.', '["49,50,51,52,"]', '2021-12-08 09:55:06', '2021-12-08 09:55:06'),
(13, 2, 'Cheese', '37520J74', '53', 'cream,White', 'KG', 'Cheese is a dairy product and produced in wide ranges of flavors, textures and forms by coagulation of the milk protein casein. It comprises proteins and fat from milk, usually the milk of cows, buffalo, goats, or sheep. During production, the milk is usually acidified and the enzymes of either rennet or bacterial enzymes with similar activity are added to cause the casein to coagulate. The solid curds are then separated from the liquid whey and pressed into finished cheese.[1] Some cheeses have aromatic molds on the rind, the outer layer, or throughout. Most cheeses melt at cooking temperature.', '["53,55,56,53,55,56,54,"]', '2021-12-09 04:30:24', '2021-12-09 04:30:24');
